ng data.\n\n## Note 2: Counts and corrections made after these times will be carried forward to the next reporting cycle for that specific region. Delayed reporting for any specific country, territory or area may result in pooled counts for multiple days being presented, with a retrospective update to counts on previous days to accurately reflect trends. Significant data errors detected or reported to WHO may be corrected at more frequent intervals.\n\n## Hospitalizations and intensive care unit (ICU) admissions: data is collected from official sources and collated by World in Data.\n\n## Testing for COVID-19: this data is collected by the Our World in Data team from official reports; you can find further details in the post on COVID-19 testing, including checklist of questions to understand testing data, information on geographical and temporal coverage, and detailed country-by-country source information. On 23 June 2022 on kaggle.\n\n## Vaccinations against COVID-19: this data is collected by the Our World in Data team from official reports.\n\n## Other variables: this data is collected from a variety of sources (United Nations, World Bank, Global Burden of Disease, Blavatnik School of Government, etc.). More information is available in our codebook","metadata":{}},{"cell_type":"code","source":"# cleaning data\n\n# Make sure date column is in Date format\ncovid_data <- covid_data %>%\n  mutate(date = as.Date(date)) %>%\n  filter(!is.na(new_cases), !is.na(new_deaths))","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-07-27T11:44:03.353546Z","iopub.execute_input":"2025-07-27T11:44:03.355183Z","iopub.status.idle":"2025-07-27T11:44:04.012523Z","shell.execute_reply":"2025-07-27T11:44:04.010617Z"}},"outputs":[],"execution_count":78},{"cell_type":"code","source":"glimpse(covid_data)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-07-27T11:44:20.293389Z","iopub.execute_input":"2025-07-27T11:44:20.295092Z","iopub.status.idle":"2025-07-27