 120),\n  total_deaths = c(1, 2, 5, 0, 1, 2),\n  total_recovered = c(50, 70, 100, 20, 30, 50) # Include if available\n)\ndata.frame","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-07-27T11:46:16.574177Z","iopub.execute_input":"2025-07-27T11:46:16.575751Z","iopub.status.idle":"2025-07-27T11:46:16.600083Z","shell.execute_reply":"2025-07-27T11:46:16.598282Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<pre class=language-r><code>function (..., row.names = NULL, check.rows = FALSE, check.names = TRUE, \n<span style=white-space:pre-wrap>    fix.empty.names = TRUE, stringsAsFactors = FALSE) </span>\n{\n<span style=white-space:pre-wrap>    data.row.names &lt;- if (check.rows &amp;&amp; is.null(row.names)) </span>\n<span style=white-space:pre-wrap>        function(current, new, i) {</span>\n<span style=white-space:pre-wrap>            if (is.character(current)) </span>\n<span style=white-space:pre-wrap>                new &lt;- as.character(new)</span>\n<span style=white-space:pre-wrap>            if (is.character(new)) </span>\n<span style=white-space:pre-wrap>                current &lt;- as.character(current)</span>\n<span style=white-space:pre-wrap>            if (anyDuplicated(new)) </span>\n<span style=white-space:pre-wrap>                return(current)</span>\n<span style=white-space:pre-wrap>            if (is.null(current)) </span>\n<span style=white-space:pre-wrap>                return(new)</span>\n<span style=white-space:pre-wrap>            if (all(current == new) || all(current == \"\")) </span>\n<span style=white-space:pre-wrap>                return(new)</span>\n<span style=white-space:pre-wrap>            stop(gettextf(\"mismatch of row names in arguments of 'data.frame', item %d\", </span>\n<span style=white-space:pre-wrap>                i), domain = NA)</span>\n<span style=white-space:pre-wrap>        }</span>\n<span style=white-space:pre-wrap>    else function(current, new, i) {</span>\n<span style=white-space:pre-wrap>        current %||% if (anyDuplicated(new)) {</span>\n<span style=white-space:pre-wrap>            warning(gettextf(\"some row.names duplicated: %s --&gt; row.names NOT used\", </span>\n<span style=white-space:pre-wrap>                paste(which(duplicated(new)), collapse = \",\")), </span>\n<span style=white-space:pre-wrap>                domain = NA)</span>\n<span style=white-space:pre-wrap>            current</span>\n<span style=white-space:pre-wrap>        }</span>\n<span style=white-space:pre-wrap>        else new</span>\n<span style=white-space:pre-wrap>    }</span>\n<span style=white-space:pre-wrap>    object &lt;- as.list(substitute(list(...)))[-1L]</span>\n<span style=white-space:pre-wrap>    mirn &lt;- missing(row.names)</span>\n<span style=white-space:pre-wrap>    mrn &lt;- is.null(row.names)</span>\n<span style=white-space:pre-wrap>    x &lt;- list(...)</span>\n<span style=white-space:pre-wrap>    n &lt;- length(x)</span>\n<span style=white-space:pre-wrap>    if (n &lt; 1L) {</span>\n<span style=white-space:pre-wrap>        if (!mrn) {</span>\n<span style=white-space:pre-wrap>            if (is.object(row.names) || !is.integer(row.names)) </span>\n<span style=white-space:pre-wrap>                row.names &lt;- as.character(row.names)</span>\n<span style=white-space:pre-wrap>            if (anyNA(row.names)) </span>\n<span style=white-space:pre-wrap>                stop(\"row names contain missing values\")</span>\n<span style=white-space:pre-wrap>            if (anyDuplicated(row.names)) </span>\n<span style=white-space:pre-wrap>                stop(gettextf(\"duplicate row.names: %s\", paste(unique(row.names[duplicated(row.names)]), </span>\n<span style=white-space:pre-wrap>                  collapse = \", \")), domain = NA)</span>\n<span style=white-space:pre-wrap>        }</span>\n<span style=white-space:pre-wrap>        else row.names &lt;- integer()</span>\n<span style=white-space:pre-wrap>        return(structure(list(), names = character(), row.names = row.names, </span>\n<span style=white-space:pre-wrap>            class = \"data.frame\"))</span>\n<span style=white-space:pre-wrap>    }</span>\n<span style=white-space:pre-wrap>    vnames &lt;- names(x)</span>\n<span style=white-space:pre-wrap>    if (length(vnames) != n) </span>\n<span style=white-space:pre-wrap>        vnames &lt;- character(n)</span>\n<span style=white-space:pre-wrap>    no.vn &lt;- !nzchar(vnames)</span>\n<span style=white-space:pre-wrap>    vlist &lt;- vnames &lt;- as.list(vnames)</span>\n<span style=white-space:pre-wrap>    nrows &lt;- ncols &lt;- integer(n)</span>\n<span style=white-space:pre-wrap>    for (i in seq_len(n)) {</span>\n<span style=white-space:pre-wrap>        xi &lt;- if (is.character(x[[i]]) || is.list(x[[i]])) </span>\n<span style=white-space:pre-wrap>            as.data.frame(x[[i]], optional = TRUE, stringsAsFactors = stringsAsFactors)</span>\n<span style=white-space:pre-wrap>        else as.data.frame(x[[i]], optional = TRUE)</span>\n<span style=white-space:pre-wrap>        nrows[i] &lt;- .row_names_info(xi)</span>\n<span style=white-space:pre-wrap>        ncols[i] &lt;- length(xi)</span>\n<span style=white-space:pre-wrap>        namesi &lt;- names(xi)</span>\n<span style=white-space:pre-wrap>        if (ncols[i] &gt; 1L) {</span>\n<span style=white-space:pre-wrap>            if (length(namesi) == 0L) </span>\n<span style=white-space:pre-wrap>                namesi &lt;- seq_len(ncols[i])</span>\n<span style=white-space:pre-wrap>            vnames[[i]] &lt;- if (no.vn[i]) </span>\n<span style=white-space:pre-wrap>                namesi</span>\n<span style=white-space:pre-wrap>            else paste(vnames[[i]], namesi, sep = \".\")</span>\n<span style=white-space:pre-wrap>        }</span>\n<span style=white-space:pre-wrap>        else if (length(namesi)) {</span>\n<span style=white-space:pre-wrap>            vnames[[i]] &lt;- namesi</span>\n<span style=white-space:pre-wrap>        }</span>\n<span style=white