              xi1 &lt;- xi[[j]]</span>\n<span style=white-space:pre-wrap>                if (is.vector(xi1) || is.factor(xi1)) </span>\n<span style=white-space:pre-wrap>                  xi[[j]] &lt;- rep(xi1, length.out = nr)</span>\n<span style=white-space:pre-wrap>                else if (is.character(xi1) &amp;&amp; inherits(xi1, \"AsIs\")) </span>\n<span style=white-space:pre-wrap>                  xi[[j]] &lt;- structure(rep(xi1, length.out = nr), </span>\n<span style=white-space:pre-wrap>                    class = class(xi1))</span>\n<span style=white-space:pre-wrap>                else if (inherits(xi1, \"Date\") || inherits(xi1, </span>\n<span style=white-space:pre-wrap>                  \"POSIXct\")) </span>\n<span style=white-space:pre-wrap>                  xi[[j]] &lt;- rep(xi1, length.out = nr)</span>\n<span style=white-space:pre-wrap>                else {</span>\n<span style=white-space:pre-wrap>                  fixed &lt;- FALSE</span>\n<span style=white-space:pre-wrap>                  break</span>\n<span style=white-space:pre-wrap>                }</span>\n<span style=white-space:pre-wrap>            }</span>\n<span style=white-space:pre-wrap>            if (fixed) {</span>\n<span style=white-space:pre-wrap>                vlist[[i]] &lt;- xi</span>\n<span style=white-space:pre-wrap>                next</span>\n<span style=white-space:pre-wrap>            }</span>\n<span style=white-space:pre-wrap>        }</span>\n<span style=white-space:pre-wrap>        stop(gettextf(\"arguments imply differing number of rows: %s\", </span>\n<span style=white-space:pre-wrap>            paste(unique(nrows), collapse = \", \")), domain = NA)</span>\n<span style=white-space:pre-wrap>    }</span>\n<span style=white-space:pre-wrap>    value &lt;- unlist(vlist, recursive = FALSE, use.names = FALSE)</span>\n<span style=white-space:pre-wrap>    vnames &lt;- as.character(unlist(vnames[ncols &gt; 0L]))</span>\n<span style=white-space:pre-wrap>    if (fix.empty.names &am