gth\")</span>\n<span style=white-space:pre-wrap>    }</span>\n<span style=white-space:pre-wrap>    else if (!is.null(row.names) &amp;&amp; length(row.names) != nr) {</span>\n<span style=white-space:pre-wrap>        warning(\"row names were found from a short variable and have been discarded\")</span>\n<span style=white-space:pre-wrap>        row.names &lt;- NULL</span>\n<span style=white-space:pre-wrap>    }</span>\n<span style=white-space:pre-wrap>    class(value) &lt;- \"data.frame\"</span>\n<span style=white-space:pre-wrap>    if (is.null(row.names)) </span>\n<span style=white-space:pre-wrap>        attr(value, \"row.names\") &lt;- .set_row_names(nr)</span>\n<span style=white-space:pre-wrap>    else {</span>\n<span style=white-space:pre-wrap>        if (is.object(row.names) || !is.integer(row.names)) </span>\n<span style=white-space:pre-wrap>            row.names &lt;- as.character(row.names)</span>\n<span style=white-space:pre-wrap>        if (anyNA(row.names)) </span>\n<span style=white-space:pre-wrap>            stop(\"row names contain missing values\")</span>\n<span style=white-space:pre-wrap>        if (anyDuplicated(row.names)) </span>\n<span style=white-space:pre-wrap>            stop(gettextf(\"duplicate row.names: %s\", paste(unique(row.names[duplicated(row.names)]), </span>\n<span style=white-space:pre-wrap>                collapse = \", \")), domain = NA)</span>\n<span style=white-space:pre-wrap>        row.names(value) &lt;- row.names</span>\n<span style=white-space:pre-wrap>    }</span>\n<span style=white-space:pre-wrap>    value</span>\n}</code></pre>","text/markdown":"```r\nfunction (..., row.names = NULL, check.rows = FALSE, check.names = TRUE, \n    fix.empty.names = TRUE, stringsAsFactors = FALSE) \n{\n    data.row.names <- if (check.rows && is.null(row.names)) \n        function(current, new, i) {\n            if (is.character(current)) \n                new <- as.character(new)\n            if (is.character(new)) \n                current <- as.character(current)\n            if (anyDuplicated(new)) \n                return(current)\n            if (is.null(current)) \n                return(new)\n            if (all(current == new) || all(current == \"\")) \n                return(new)\n            stop(gettextf(\"mismatch of row names in arguments of 'data.frame', item %d\", \n                i), domain = NA)\n        }\n    else function(current, new, i) {\n        current %||% if (anyDuplicated(new)) {\n            warning(gettextf(\"some row.names duplicated: %s --> row.names NOT used\", \n                paste(which(duplicated(new)), collapse = \",\")), \n                domain = NA)\n            current\n        }\n        else new\n    }\n    object <- as.list(substitute(list(...)))[-1L]\n    mirn <- missing(row.names)\n    mrn <- is.null(row.names)\n    x <- list(...)\n    n <- length(x)\n    if (n < 1L) {\n        if (!mrn) {\n            if (is.object(row.names) || !is.integer(row.names)) \n                row.names <- as.character(row.names)\n            if (anyNA(row.names)) \n                stop(\"row names contain missing values\")\n            if (anyDuplicated(row.names)) \n                stop(gettextf(\"duplicate row.names: %s\", paste(unique(row.names[duplicated(row.names)]), \n                  collapse = \", \")), domain = NA)\n        }\n        else row.names <- integer()\n        return(structure(list(), names = character(), row.names = row.names, \n            class = \"data.frame\"))\n    }\n    vnames <- names(x)\n    if (length(vnames) != n) \n        vnames <- character(n)\n    no.vn <- !nzchar(vnames)\n    vlist <- vnames <- as.list(vnames)\n    nrows <- ncols <- integer(n)\n    for (i in seq_len(n)) {\n        xi <- if (is.character(x[[i]]) || is.list(x[[i]])) \n            as.data.frame(x[[i]], optional = TRUE, stringsAsFactors = stringsAsFactors)\n        else as.data.frame(x[[i]], optional = TRUE)\n        nrows[i] <- .row_names_info(xi)\n        ncols[i] <- length(xi)\n        namesi <- names(xi)\n        if (ncols[i] > 1L) {\n            if (length(namesi) == 0L) \n                namesi <- seq_len(ncols[i])\n            vnames[[i]] <- if (no.vn[i]) \n                namesi\n            else paste(vnames[[i]], namesi, sep = \".\")\n        }\n        else if (length(namesi)) {\n            vnames[[i]] <- namesi\n        }\n        else if (fix.empty.names && no.vn[[i]]) {\n            tmpname <- deparse(object[[i]], nlines = 1L)[1L]\n            if (startsWith(tmpname, \"I(\") && endsWith(tmpname, \n                \")\")) {\n                ntmpn <- nchar(tmpname, \"c\")\n                tmpname <- substr(tmpname, 3L, ntmpn - 1L)\n            }\n            vnames[[i]] <- tmpname\n        }\n        if (mirn && nrows[i] > 0L) {\n            rowsi <- attr(xi, \"row.names\")\n            if (any(nzchar(rowsi))) \n                row.names <- data.row.names(row.names, rowsi, \n                  i)\n        }\n        nrows[i] <- abs(nrows[i])\n        vlist[[i]] <- xi\n    }\n    nr <- max(nrows)\n    for (i in seq_len(n)[nrows < nr]) {\n        xi <- vlist[[i]]\n        if (nrows[i] > 0L && (nr%%nrows[i] == 0L)) {\n            xi <- unclass(xi)\n            fixed <- TRUE\n            for (j in seq_along(xi)) {\n                xi1 <- xi[[j]]\n                if (is.vector(xi1) || is.factor(xi1)) \n                  xi[[j]] <- rep(xi1, length.out = nr)\n                else if (is.character(xi1) && inherits(xi1, \"AsIs\")) \n                  xi[[j]] <- structure(rep(xi1, length.out = nr), \n                    class = class(xi1))\n                else if (inherits(xi1, \"Date\") || inherits(xi1, \n                  \"POSIXct\")) \n                  xi[[j]] <- rep(xi1, length.out = nr)\n                else {\n                  fixed <- FALSE\n                  break\n                }\n            }\n            if (fixed) {\n                vlist[[i]] <- xi\n                next\n            }\n        }\n        stop(gettextf(\"arguments imply differing number of rows: %s\", \n            paste(unique(nrows), collapse = \", \")), domain = NA)\n    }\n    value <- unlist(vlist, recursive = FALSE, use.names = FALSE)\n    vnames <- as.character(unlist(vnames[ncols > 0L]))\n    if (fix.empty.names && any(noname <- !nzchar(vnames))) \n        vnames[noname] <- paste0(\"Var.\", seq_along(vnames))[noname]\n    if (check.names) {\n        if (fix.empty.names) \n            vnames <- make.names(vnames, unique = TRUE)\n        else {\n            nz <- nzchar(vnames)\n            vnames[nz] <- make.names(vnames[nz], unique = TRUE)\n        }\n    }\n    names(value) <- vnames\n    if (!mrn) {\n        if (length(row.names) == 1L && nr != 1L) {\n            if (is.character(row.names)) \n                row.names <- match(row.names, vnames, 0L)\n            if (length(row.names) != 1L || row.names < 1L || \n                row.names > length(vnames)) \n                stop(\"'row.names' should specify one of the variables\")\n            i <- row.names\n            row.names <- value[[i]]\n            value <- value[-i]\n        }\n        else if (!is.null(row.names) && length(row.names) != \n            nr) \n            stop(\"row names supplied are of the wrong length\")\n    }\n    else if (!is.null(row.names) && length(row.names) != nr) {\n        warning(\"row names were found from a short variable and have been discarded\")\n        row.names <- NULL\n    }\n    class(value) <- \"data.frame\"\n    if (is.null(row.names)) \n        attr(value, \"row.names\") <- .set_row_names(nr)\n    else {\n        if (is.object(row.names) || !is.integer(row.names)) \n            row.names <- as.character(row.names)\n        if (anyNA(row.names)) \n            stop(\"row names contain missing values\")\n        if (anyDuplicated(row.names)) \n            stop(gettextf(\"duplicate row.names: %s\", paste(unique(row.names[duplicated(row.names)]), \n                collapse = \", \")), domain = NA)\n        row.names(value) <- row.names\n    }\n    value\n}\n```","text/latex":"\\begin{minted}{r}\nfunction (..., row.names = NULL, check.rows = FALSE, check.names = TRUE, \n    fix.empty.names = TRUE, stringsAsFactors = FALSE) \n\\{\n    data.row.names <- if (check.rows \\&\\& is.null(row.names)) \n        function(current, new, i) \\{\n            if (is.character(current)) \n                new <- as.character(new)\n            if (is.character(new)) \n                current <- as.character(current)\n            if (anyDuplicated(new)) \n                return(current)\n            if (is.null(current)) \n                return(new)\n            if (all(current == new) \\textbar{}\\textbar{} all(current == \"\")) \n                return(new)\n            stop(gettextf(\"mismatch of row names in arguments of 'data.frame', item \\%d\", \n                i), domain = NA)\n        \\}\n    else function(current, new, i) \\{\n        current \\%\\textbar{}\\textbar{}\\% if (anyDuplicated(new)) \\{\n            warning(gettextf(\"some row.names duplicated: \\%s --> row.names NOT used\", \n                paste(which(duplicated(new)), collapse = \",\")), \n                domain = NA)\n            current\n        \\}\n        else new\n    \\}\n    object <- as.list(substitute(list(...))){[}-1L{]}\n    mirn <- missing(row.names)\n    mrn <- is.null(row.names)\n    x <- list(...)\n    n <- length(x)\n    if (n < 1L) \\{\n        if (!mrn) \\{\n            if (is.object(row.names) \\textbar{}\\textbar{} !is.integer(row.names)) \n                row.names <- as.character(row.names)\n            if (anyNA(row.names)) \n                stop(\"row names contain missing values\")\n            if (anyDuplicated(row.names)) \n                stop(gettextf(\"duplicate row.names: \\%s\", paste(unique(row.names{[}duplicated(row.names){]}), \n                  collapse = \", \")), domain = NA)\n        \\}\n        else row.names <- integer()\n        return(structure(list(), names = character(), row.names = row.names, \n            class = \"data.frame\"))\n    \\}\n    vnames <- names(x)\n    if (length(vnames) != n) \n        vnames <- character(n)\n    no.vn <- !nzchar(vnames)\n    vlist <- vnames <- as.list(vnames)\n    nrows <- ncols <- integer(n)\n    for (i in seq\\_len(n)) \\{\n        xi <- if (is.character(x{[}{[}i{]}{]}) \\textbar{}\\textbar{} is.list(x{[}{[}i{]}{]})) \n            as.data.frame(x{[}{[}i{]}{]}, optional = TRUE, stringsAsFactors = stringsAsFactors)\n        else as.data.frame(x{[}{[}i{]}{]}, optional = TRUE)\n        nrows{[}i{]} <- .row\\_names\\_info(xi)\n        ncols{[}i{]} <- length(xi)\n        namesi <- names(xi)\n        if (ncols{[}i{]} > 1L) \\{\n            if (length(namesi) == 0L) \n                namesi <- seq\\_len(ncols{[}i{]})\n            vnames{[}{[}i{]}{]} <- if (no.vn{[}i{]}) \n                namesi\n            else paste(vnames{[}{[}i{]}{]}, namesi, sep = \".\")\n        \\}\n        else if (length(namesi)) \\{\n            vnames{[}{[}i{]}{]} <- namesi\n        \\}\n        else if (fix.empty.names \\&\\& no.vn{[}{[}i{]}{]}) \\{\n            tmpname <- deparse(object{[}{[}i{]}{]}, nlines = 1L){[}1L{]}\n            if (startsWith(tmpname, \"I(\") \\&\\& endsWith(tmpname, \n                \")\")) \\{\n                ntmpn <- nchar(tmpname, \"c\")\n                tmpname <- substr(tmpname, 3L, ntmpn - 1L)\n            \\}\n            vnames{[}{[}i{]}{]} <- tmpname\n        \\}\n        if (mirn \\&\\& nrows{[}i{]} > 0L) \\{\n            rowsi <- attr(xi, \"row.names\")\n            if (any(nzchar(rowsi))) \n                row.names <- data.row.names(row.names, rowsi, \n                  i)\n        \\}\n        nrows{[}i{]} <- abs(nrows{[}i{]})\n        vlist{[}{[}i{]}{]} <- xi\n    \\}\n    nr <- max(nrows)\n    for (i in seq\\_len(n){[}nrows < nr{]}) \\{\n        xi <- vlist{[}{[}i{]}{]}\n        if (nrows{[}i{]} > 0L \\&\\& (nr\\%\\%nrows{[}i{]} == 0L)) \\{\n            xi <- unclass(xi)\n 