8  "},"metadata":{}}],"execution_count":98},{"cell_type":"markdown","source":"# Visualization 1: Metrics by Region (Continent)","metadata":{}},{"cell_type":"code","source":"# --- Visualization 1: Metrics by Region (Continent) ---\n# Bar chart: Average Total Cases Per Million by Continent\n\ncases_by_continent <- latest_data1 %>%\n  group_by(continent) %>%\n  summarise(\n    avg_cases_per_million = mean(total_cases_per_million, na.rm = TRUE)\n  ) %>%\n  ungroup() %>%\n  arrange(desc(avg_cases_per_million)) # Order for better visualization\n\nplot_continent_cases <- ggplot(cases_by_continent, aes(x = reorder(continent, -avg_cases_per_million), y = avg_cases_per_million, fill = continent)) +\n  geom_col() +\n  scale_y_continuous(labels = comma) +\n  labs(\n    title = \"Average Total COVID-19 Cases per Million by Continent\", subtitle = \"Data represents latest available figures per country, averaged by continent\", \n    x = \"Continent\",\n    y = \"Average Total Cases per Million\",\n    fill = \"Continent\",\n    caption = \"Source: COVID-19 global dataset Visualitions\\n by www.datacalculations.com\"\n  ) +\n  theme_minimal() +\n  theme(\n    plot.title = element_text(face = \"bold\", size = 16, color = \"darkgrey\"),\n      plot.subtitle = element_text(size = 12, color = \" darkgrey\"),\n      plot.caption = element_text(color = \"blue\", size = 12),\n    axis.text.x = element_text(angle = 45, hjust = 1),\n    legend.position = \"none\" # Hide redundant legend if fill is mapped to x-axis\n  )\nplot_continent_cases","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-07-27T11:49:55.419049Z","iopub.execute_input":"2025-07-27T11:49:55.420657Z","iopub.status.idle":"2025-07-27T11:49:55.702762Z","shell.execute_reply":"2025-07-27T11:49:55.700407Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ5gc13kn+re6OndPzjknYBIikQNJkAQzCUJeP7K9kmzZssIjee3nsb2yJV0l\n